import React, { Component } from 'react';
import Regular from './Regular'

class App extends Component {
    render() {
        return (
            <div className="App">
                <button onClick={this.changeFrog}>Frog Mode</button>
                {Regular}
            </div>
        );
    }
}

export default App;
